void doReselect()
{
    InventTransferParmTable  inventTransferParmTableTmp = inventTransferParmTable.data();

    inventTransferParmTable_ds.executeQuery();

    if (inventTransferParmTableTmp.RecId)
    {
        element.args().lookupRecord(inventTransferParmTableTmp);
        inventTransferParmTable_ds.research(false);
    }
}

void enableFieldsActive()
