public void init()
{
    // This method is same as sys layer
    InventDimParm   inventDimParm;

    inventTransferMultiReceive = element.args().caller();

    // <GIN>
    isINCountryRegion = SysCountryRegionCode::isLegalEntityInCountryRegion([#isoIN]);
    // </GIN>
    isBRCountryRegion = SysCountryRegionCode::isLegalEntityInCountryRegion([#isoBR]);

    if (#PdsCatchWeightEnabled)
    {
        lineFrmCtrl = PdsCWFormCtrl::constructFromForm(element);
        lineFrmCtrl.parmFieldIds(PdsCWValidation::fieldMapFromContainers(
            [[fieldnum(InventTransferParmLine,QtyReceiveNow),
                fieldnum(InventTransferParmLine,PdsCWQtyReceiveNow),
                false],
             [fieldnum(InventTransferParmLine,QtyScrapNow),
                fieldnum(InventTransferParmLine,PdsCWQtyScrapNow),
                false]]
            ));
        lineFrmCtrl.parmItemFieldId(fieldnum(InventTransferParmLine,ItemId));
        lineFrmCtrl.parmUnitMethodStr(tablemethodstr(InventTransferParmLine,pdsCWUnitId));
        lineFrmCtrl.initPre();
    }

    super();

    if (TaxIntegrationUtils::isTaxInTransferOrderEnabled())
    {
        TaxTransSource.visible(true);
    }

    element.updateDesign(InventDimFormDesignUpdate::Init);

    inventDimFormSetupReceiveList  = InventDimCtrl_Frm_SimpleRightClick::newFromForm(element);
    inventDimParm.InventSiteIdFlag      = NoYes::Yes;
    inventDimParm.InventLocationIdFlag  = NoYes::Yes;
    inventDimFormSetupReceiveList.parmDimParmLockedRightClick(inventDimParm.data());

    calledFromWMSArrival = inventTransferMultiReceive.parmCalledFromWMS();

    if (calledFromWMSArrival)
    {
        element.enableUIForWMSRecieve();
    }

    if (lineFrmCtrl)
    {
        lineFrmCtrl.initPost();
    }

    // <GEERU>
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]) || BrazilParameters::isEnabled())
    {
        inventTransferParmTable_VoucherShipmentId.label("@GLS113801");
        inventTransferParmTable_VoucherShipmentId.helpText("@GLS113802");

        receive_VoucherShipmentId.label("@GLS113801");
        receive_VoucherShipmentId.helpText("@GLS113802");

        groupParmUpdate.heightMode(FormHeight::Auto);
        groupParmUpdate.columns(2);
    }
    // </GEERU>
    // <GIN>
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoIN]))
    {
        SetupLine_IN.visible(true);
    }
    // </GIN>
    // <GTE>
    if (TaxSolutionScopeIntegrationUtil::isCompanyEnabled())
    {
        TaxDocumentLauncher.visible(true);
    }
    // </GTE>

    if (BrazilParameters::isEnabled())
    {
        this.updateDesign_BR();
    }
}

