void updateDesign(InventDimFormDesignUpdate mode)
{
    InventTransferLine  inventTransferLine = InventTransferLine::findTransIdReceive(inventTransferParmLine.InventTransId);
    InventMovement      localMovement = InventMovement::construct(inventTransferLine);

    if (!inventDimFormSetup)
    {
        inventDimFormSetup  = InventDimCtrl_Frm_Mov_TransferOrder::newFromFormMovement(element,localMovement);
    }

    InventTransferTable::formUpdateDesign(inventDimFormSetup,localMovement,mode,true);

    // <GIN>
    GateEntryDetails_IN.visible(this.isStockTransfer_IN());
    // </GIN>
}

