void removeEWayBill_IN(InventTransferParmTable _inventTransferParmTable)
{
    // <GIN>
    TransitDocEWayBillController_IN     controller;

    ttsBegin;

    controller = TransitDocEWayBillController_IN::newController(
    TransitDocumentManager_IN::newManager());

    // Remove all attached forms
    controller.removeAttachedForms(_inventTransferParmTable);

    ttsCommit;
    // </GIN>
}

