private void showThirdPartyFiscalDocumentFields_BR()
{
    boolean displayFields = false;

    if (SysQuery::countLoops( new QueryRun(inventTransferParmTable_ds.query())) == 1)
    {
        if (this.canReceiveThirdPartyFiscalDocument_BR())
        {
            displayFields = true;
        }
    }
    else
    {
        displayFields = true;
    }

    InventTransferParmTableFiscalInfo_BR_ThirdPartyEFDocAccessKey_BR.visible(displayFields);
    InventTransferParmTableFiscalInfo_BR_ThirdPartyFiscalDocumentNumber.visible(displayFields);
    InventTransferParmTableFiscalInfo_BR_ThirdPartyFiscalDocumentSeries.visible(displayFields);
    InventTransferParmTableFiscalInfo_BR_ThirdPartyFiscalDocumentSpecie.visible(displayFields);
    InventTransferParmTableFiscalInfo_BR_ThirdPartyFiscalDocumentModel.visible(displayFields);
    InventTransferParmTableFiscalInfo_BR_ThirdPartyFiscalDocumentDate.visible(displayFields);
}

private InventTransferOrderType_BR getInventTransferOrderType_BR()
{
    InventTransferTableFiscalInfo_BR    inventTransferTableFiscalInfo;
    InventTransferTable                 inventTransferTable;

    select InventTransferOrderType from inventTransferTableFiscalInfo
        exists join inventTransferTable
            where inventTransferTableFiscalInfo.InventTransferTable == inventTransferTable.RecId
                && inventTransferTable.TransferId == InventTransferParmTable.TransferId;

    return inventTransferTableFiscalInfo.InventTransferOrderType;
}

private boolean canReceiveThirdPartyFiscalDocument_BR()
{
    return this.getInventTransferOrderType_BR() == InventTransferOrderType_BR::ThirdPartyReturn;
}

public int active()
{
    int ret;
    InventDimParm   inventDimParm;

    ret = super();

    element.ctrlPrintButton(inventTransferParmTable.PrintTransferReceipt);
    element.enableFieldsActive();

    InventDimFixedClass::inventDimFixed2InventDimParm(inventTransferParmTable.InventDimFixedReceiveList,inventDimParm);
    inventDimFormSetupReceiveList.parmDimParmVisibleGrid(inventDimParm,true);

    if (!calledFromWMSArrival)
    {
        this.object(fieldnum(InventTransferParmTable,ExplodeLines)).allowEdit(inventTransferParmTable.EditLines);
        this.object(fieldnum(InventTransferParmTable,ExplodeLines)).enabled(inventTransferParmTable.EditLines);
    }
    // <GIN>
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoIN]))
    {
        boolean isStockTransfer = element.isStockTransfer_IN();
        SetupLine_IN.enabled(isStockTransfer);
        tabFinancialDimensionLine_IN.visible(isStockTransfer && !InventTransferTable::find(inventTransferParmTable.TransferId).StockTransferCostPriceHandlingImprovement_IN);
        InventTransferParmLine_IN_AssessableValue.visible(isStockTransfer);

        InventTransferParmLine_IN_DS.object(fieldNum(InventTransferParmLine_IN, InventSiteGateEntryLine)).visible(isStockTransfer);
        GateEntryDetails_IN.visible(isStockTransfer);
    }
    // </GIN>

    // <GBR>
    if (BrazilParameters::isEnabled())
    {
        InventTransferParmTableFiscalInfo_BR_ds.allowEdit(this.canReceiveThirdPartyFiscalDocument_BR());

        allowEditReceiveLines = (InventTransferParmTable_ds.getInventTransferOrderType_BR() != InventTransferOrderType_BR::FiscalEstablishmentTransfer
                && InventTransferParmTable_ds.getInventTransferOrderType_BR() != InventTransferOrderType_BR::FiscalEstablishmentReturn);

        InventTransferParmLine_ds.allowDelete(allowEditReceiveLines);
    }
    // </GBR>

    return ret;
}

