public void calcInventTax_IN()
{
    InventTransLineTax_IN inventLineTax;

    if (InventTransferTable::find(inventTransferParmTable.TransferId).TransferType_IN == TransferType_IN::StockTransfer)
    {
        inventLineTax = InventTransLineTax_IN::construct(InventTransferParmTable, InventTransferParmTable.TransDate);
        inventLineTax.calc();
        Tax::showTaxes(menuitemDisplayStr(TaxTmpWorkTransferOrder_IN), inventLineTax, InventTransferParmTable);
    }
}

