public boolean validate()
{
    InventTransferJour inventTransferJour;

    boolean ret;

    ret = super();

    inventTransferJour = InventTransferJour::find(InventTransferParmTable.TransferId, InventTransferParmTable.VoucherShipmentId);

    if (inventTransferJour.UpdateType == InventTransferUpdateType::Shipment
        && (inventTransferJour.Return_RU
        || FiscalDocument_BR::findByRef(inventTransferJour.TableId, inventTransferJour.RecId).Status == FiscalDocumentStatus_BR::Cancelled
        || inventTransferJour.CanceledShipment == NoYes::Yes))
    {
        ret = checkFailed("@GLS222796");
    }

    if (inventTransferJour.isCanceled())
    {
        ret = checkFailed("@SCM:VoucherShipmentIdValidate");
    }

    return ret;
}

public void lookup(FormControl _formControl, str _filterStr)
{
    // <GEERU>
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]) || BrazilParameters::isEnabled())
    {
        InventTransferJour::lookupShipmentVoucher(_formControl,
                                                  inventTransferParmTable.TransferId,
                                                  inventTransferParmTable.ReceiveUpdateQty);
    }
    else
    {
        // </GEERU>
        InventTransferJour::lookupShipmentVoucher(_formControl, inventTransferParmTable.TransferId);
        // <GEERU>
    }
    // </GEERU>
}

