void write()
{
    inventTransferParmLine.InventDimId    = InventDim::findOrCreate(inventDim).InventDimId;

    if (lineFrmCtrl)
    {
        lineFrmCtrl.dataSourceWritePre();
    }

    super();

    if (inventTransferParmLine.InventDimId != inventDim.InventDimId)
    {
        inventDim.data(InventDim::find(inventTransferParmLine.InventDimId));
        inventDim_ds.setCurrent();
    }

    if (isBRCountryRegion)
    {
        InventTransferParmLine_BR.SysExtensionSerializerExtensionMap::insertAfterBaseTable(InventTransferParmLine);
    }
}

