public void updateDesign_BR(boolean _isNFE)
{
    InventTransferParmTableFiscalInfo_BR_ds.object(fieldNum(InventTransferParmTableFiscalInfo_BR, ThirdPartyFiscalDocumentNumber)).skip(_isNFE);
    InventTransferParmTableFiscalInfo_BR_ds.object(fieldNum(InventTransferParmTableFiscalInfo_BR, ThirdPartyFiscalDocumentSeries)).skip(_isNFE);
    InventTransferParmTableFiscalInfo_BR_ds.object(fieldNum(InventTransferParmTableFiscalInfo_BR, ThirdPartyEFDocAccessKey_BR)).skip(!_isNFE);

    InventTransferParmTableFiscalInfo_BR_ds.object(fieldNum(InventTransferParmTableFiscalInfo_BR, ThirdPartyFiscalDocumentNumber)).allowEdit(!_isNFE);
    InventTransferParmTableFiscalInfo_BR_ds.object(fieldNum(InventTransferParmTableFiscalInfo_BR, ThirdPartyFiscalDocumentSeries)).allowEdit(!_isNFE);
    InventTransferParmTableFiscalInfo_BR_ds.object(fieldNum(InventTransferParmTableFiscalInfo_BR, ThirdPartyEFDocAccessKey_BR)).allowEdit(_isNFE);
}

